import React, { useEffect, useState } from "react";

const FetchApi = () => {
  let [store, setStore] = useState();
  useEffect(() => {
    fetch("https://fakestoreapi.com/products")
      .then((res) => res.json())
      .then((data) => setStore(data));
  });
  return (
    <>
      <div>
        {store.map((elem) => {
          let { id, title, prise, description, image } = elem;
          return (
            <>
              <img src={image} alt="" />
            </>
          );
        })}
      </div>
    </>
  );
};

export default FetchApi;
